    padding: 10,
    margin:10,
    width: 250,
    fontSize: 16,
    color:"white"
  },
  error:{
    fontSize:16,
    color:'red',
  },
  button: {
    backgroundColor: 'white',
    paddingVertical: 10,
    paddingHorizontal: 20,
    borderRadius: 5,
    marginTop: 20,
    color: "green"
  },
  buttonText: {
    color: 'black',
    fontSize: 16,
    fontWeight: 'bold',
  },
});

export default EditUser;
